        <img
          src="https://media.istockphoto.com/id/488938489/photo/dog-looking-through-binoculars.jpg?s=612x612&w=0&k=20&c=F1kSC-1h-1MNLMHBHCmTLIEE8BF30oyJcyvkn0XW0a4="
